function callAjaxCats(n){$.ajax({type:"POST",url:"/Home/AddScoreToCat",contentType:"application/json",dataType:"json",data:JSON.stringify(n),success:function(n){console.log(n.nextCat1.url);console.log(n.nextCat1.url);$("#imgGauche").attr("src",n.nextCat1.url);$("#imgGauche").attr("val",n.nextCat1.id);$("#imgDroite").attr("src",n.nextCat2.url);$("#imgDroite").attr("val",n.nextCat2.id);$("#votes").text(n.votes+" votes")}})}$("#imgGauche").click(function(){catId=$("#imgGauche").attr("val");callAjaxCats(catId)});$("#imgDroite").click(function(){catId=$("#imgDroite").attr("val");callAjaxCats(catId)});